import React, {Component, useState, useEffect} from 'react';
import Container from "react-bootstrap/Container";
import {Button} from "react-bootstrap";
import Next from "./Account_Setup/CreateAccount";
import {Redirect, useHistory} from 'react-router'

class Home extends Component {

constructor(props){
  super(props);
  this.state={
    condition:false
  }
}

handleClickStart = (e) =>{
  this.setState({
    condition: true
  })
  this.clickStart();
};

clickStart = () =>{
  if(this.state.condition){
    return <Redirect component={Next} />
  }
}

  render(){
    return(
      <div className="home-container-top">
        <div className="home-container">
          <div className="home-text-container">
            <p className="home-text">
              Make a website to improve your business
            </p>
            <div className="homebtn-getstarted-container">
              <Button variant="btn btn-primary"
                className="homebtn-getstarted"
                onClick={() =>{
                  this.props.history.push({Next})
                }}
                >
                Get Started
              </Button>
            </div>
          </div>
          <div className="home-image-container">
            <img
              src="https://purepng.com/public/uploads/large/purepng.com-running-womenrunnerjoggingjumpingrunning-women-1421526963993vkpyk.png"
              height="100%"
              width="100%"
            />
          </div>
        </div>
      </div>
    )};
};

export default Home;
